description.text:
This is a simple straw holder I made in SketchUp for the WD-40 can (only tested on the 360ml can for now as that's all I have). The ring snaps into place in the groove near the top of the can. Also, you can just move the ring along the length of the straw and continue usual usage, so you don't need to keep removing it :)
Our family has had many WD-40 straws go missing...I'm hoping this can put an end to it &gt;&lt;
